import logo from "./logo.svg";
import "./App.css";
import Items from "./Components/Items.js";
import { Component } from "react";

class App extends Component {
  constructor(props) {
    super(props);
    this.items = [{ title: "Di choi" }];
  }

  render() {
    return (
      <div className="App">
        {this.items.map(function (item, index) {
          <Items key={index} item />;
        })}
      </div>
    );
  }
}

export default App;
